If you don't have a rust project setup yet you can create one by running, cargo new my-library Remote Add the following to your Cargo.toml file: [dependencies]
anyhow = { version = "1.0", default-features = false }
iota-streams = { git = "https://github.com/iotaledger/streams", branch = "master"} Local Clone this repository git clone https://github.com/iotaledger/streams Add the following to your Cargo.toml file: [dependencies]
iota-streams = { version = "1.0.0", path = "../streams" }

